import Heading from './Heading';
import Hero from './Hero';
import sites from '../sites'
import Projetos from './Projetos';
import Skills from './Skills';


function createProject(site){
    return(
        <Projetos
        key={site.id}
        image={site.image}
        name={site.name}
        />
    )
}

function App(){
    return(
        <div>
        <Heading/>
        <Hero/>
        <h2 className="project-title">Projetos</h2>
        
        </div>
    
    
    )

}


export default App;
